;            x: params.x,&#xa;            y: params.y,&#xa;          });&#xa;        },&#xa;      });" LOCALIZED_STYLE_REF="defaultstyle.note" ID="ID_910510170" CREATED="1483460406727" MODIFIED="1483460415977"/>
